import HeaderPage from "./HeaderPage";
import NextHeader from "./NextHeader";
import ContainerPage from "./ContainerPage";
import pic1 from './teslaimg/Inverter_V8_D.jpg'
import pic from './teslaimg/D_PW_Hero_2880x1800.jpg'
import back from './teslaimg/solar-roof_value_D.jpg'
const Powerwall = () => {
    return ( 
        <div>
<HeaderPage
         title="Solar for Existing Roofs "
         background={back}
         description="Plaid"
         range="120min"
         time=""
         speed="$"
         horsepower="24/7"
         first
         second
      />
      <NextHeader
       background={pic}
       title="Electricity For Less ⚡ "
      />
      <ContainerPage 
       pic={pic1} 
       text="Voyagez plus loin sur u
       ne seule charge que n'importe quel autre véhicule électrique et continuez votre route avec plus de 20 000 Superchargeurs accessibles dans le monde. En combinant une autonomie allant jusqu'à 663 km à la technologie de recharge rapide Tesla, vous passerez moins de temp
       s à recharger et plus de temps sur la route."
       />
      </div>
     )
 
    ;
}
 
export default Powerwall;
  <HeaderPage />
